CREATE TABLE Listing(
    `Listing_ID` INT(30) NOT NULL,
    `Listing_name` VARCHAR(1500),
    `HostID` INT(20) NOT NULL,
    `Street` VARCHAR(1000),
    `City` VARCHAR(500),
    `Property_Type` VARCHAR(500),
    `Room_Type` VARCHAR(500),
    `Accomodates` INT(20),
    `Bathrooms` FLOAT,
    `Bedrooms` INT(10),
    `Beds` INT(10),
    `Bed_Type` VARCHAR(40),
    `Price` INT(20),
    `Weekly_Price` INT(20),
    `Monthly_Price` INT(20),
    `Security_Deposit` INT(20),
    `Cleaning_Fee` INT(20),
    `Guests` INT(10),
    `Price_ExtraPeople` INT(20),
    `Min_Nights` INT(20),
    `Availability` VARCHAR(10),
    `instant_bookable` VARCHAR(15),
    `cancellation_policy` VARCHAR(20),
    `Availability_365` INT(30),
    PRIMARY KEY (Listing_ID),
    FOREIGN KEY (HostID) REFERENCES Host (HostID)
);

