 SELECT*FROM host;
 SELECT*FROM listing;
 SELECT*FROM calendar;
 SELECT*FROM amenity;
 SELECT*FROM amenity_listing;
 SELECT*FROM review;
 
/* #1 How many listings are associated to each property type and what are their average rating for the 
overall experience as well as for the cleanliness*/
SELECT 
    L.Property_Type,
    COUNT(L.Listing_ID) AS Num_of_Listings,
    AVG(R.Review_Cleanliness) AS Avg_Clean_Rating,
    AVG(R.Overall_Experience) AS Avg_Total_Rating
FROM
    Listing AS L,
    Review AS R
WHERE
R.Listing_ID = L.Listing_ID
GROUP BY Property_Type
ORDER BY Avg_Total_Rating DESC, Avg_Clean_Rating;

/* #2 All the Listings where host response rate is greater than the average host response rate*/
SELECT 
    Listing.Listing_ID,
    Listing.Listing_name,
    Listing.City,
    Listing.Property_Type,
    Listing.Price,
    (SELECT 
            AVG(HostResponseRate) AS Avg_Response_Rate
        FROM
            Host) AS Avg_Response_Rate,
    X.HostResponseRate
FROM
    (SELECT 
        Host.HostID, Host.HostResponseRate
    FROM
        Host
    WHERE
        HostResponseRate > (SELECT 
                AVG(HostResponseRate) AS Avg_Response_Rate
            FROM
                Host)) X
        JOIN
    Listing ON Listing.HostID = X.HostID;
    
/* #3 How many listings each city have and what are their average monthly price and average overall price.*/

SELECT 
    L.City,
    COUNT(L.Listing_ID) AS Num_of_Listings,
    AVG(L.Monthly_Price) AS Avg_Monthly_Price,
    AVG(L.Price) AS Avg_Total_Price
FROM
    Listing AS L
GROUP BY City
ORDER BY Avg_Monthly_Price DESC , Avg_Total_Price DESC;

/* #4 Top 5 most expensive listings grouped by hosts.*/
SELECT L.Listing_ID, L.Listing_name, L.Price
FROM Listing AS L
GROUP BY L.HostID
ORDER BY L.Price DESC
LIMIT 5;

/* #5 Apartments in Washington with internet amenity and don’t require security deposit*/
SELECT 
    L.Listing_ID, L.Listing_name, L.Street, L.Room_Type, L.Price
FROM
    Amenity_Listing AS AL
        JOIN
    Listing AS L ON AL.Listing_ID = L.Listing_ID
        JOIN
    Amenity AS A ON A.AmenityID = AL.AmenityID
WHERE L.City = 'Washington'
        AND A.Amenities = 'Internet'
        AND L.Room_Type = 'Entire home/apt'
        AND L.Security_Deposit = '0'
ORDER BY L.Price DESC;

/* #6 What are the top 5 Hosts based on the overall rating received from the customers*/
SELECT 
    L.HostID,
    L.Listing_ID,
    H.HostName,
    AVG(R.Overall_Experience) AS Avg_Overll_Rating
FROM
    Host AS H
        JOIN
    Listing AS L ON H.HostID = L.HostID
        JOIN
    Review AS R ON R.Listing_ID = L.Listing_ID
GROUP BY H.HostID
ORDER BY Avg_Overll_Rating DESC
LIMIT 5;

/* #7 Average price by property type for Washington City and where response rate of Host is greater than 90%*/

SELECT 
    L.Property_Type,
    AVG(L.Price) AS Average_Price
FROM
    Listing AS L
WHERE
    L.HostID IN (SELECT 
            H.HostID
        FROM
            Host AS H
        WHERE
            H.HostLocation LIKE '%Washington%' AND H.HostResponseRate>0.90)
GROUP BY L.Property_Type;

/* #8 Which Listing and Host were the most expensive across all months, in which location they are present and for which property type*/
SELECT 
T.Month,
    L.Listing_ID,
    L.Listing_name,
    L.HostID,
    L.Property_Type,
    L.City,
    T.Max_Price
FROM
    (SELECT 
        Cal.Listing_ID,
            DATE_FORMAT(Cal.Date, '%M') AS Month,
            MAX(CAl.Price) AS Max_Price
    FROM
        Calendar AS Cal
    GROUP BY Month) T
        JOIN
    Listing AS L ON T.Listing_ID = L.Listing_ID
        JOIN
    Host AS H ON H.HostID = L.HostID;
    
    /*#9 Which listing has been referred the most by customers to their friends and how many friends have been referred to by the customers.*/
    SELECT 
    L.Listing_ID,
    COUNT(R.Gender) AS Total_Customers,
    SUM(Num_of_Friend_Refer) AS Friends_Referred
FROM
    Listing AS L
        JOIN
    Review AS R ON R.Listing_ID = L.Listing_ID
GROUP BY L.Listing_ID
ORDER BY Total_Customers DESC;

/*#10 In which month the listings are highly occupied*/

SELECT 
    DATE_FORMAT(Cal.Date, '%M') AS Month,
    COUNT(Cal.Available) AS Total_Occupied
FROM
    Calendar AS Cal
        JOIN
    Listing AS L ON Cal.Listing_ID = L.Listing_ID
WHERE
    Cal.Available = 'f'
GROUP BY DATE_FORMAT(Cal.Date, '%M')
ORDER BY Total_Occupied DESC;

/*#11 How many listings are available each month and what are their average price per month*/
SELECT 
    DATE_FORMAT(Cal.Date, '%M') AS Month,
    COUNT(Cal.Available) AS Total_Available,
    AVG(Cal.Price) AS avg_price
FROM
    Calendar AS Cal
        JOIN
    Listing AS L ON Cal.Listing_ID = L.Listing_ID
WHERE
    Cal.Available = 't'
GROUP BY DATE_FORMAT(Cal.Date, '%M')
ORDER BY Total_Available DESC;

/*#12 Total number of occupied listings in each city for each month*/

SELECT 
    DATE_FORMAT(Cal.Date, '%M') AS Month,
    L.City,
    COUNT(Cal.Available) AS Total_Occupied
FROM
    Calendar AS Cal
        JOIN
    Listing AS L ON Cal.Listing_ID = L.Listing_ID
WHERE
    Cal.Available = 'f'
GROUP BY DATE_FORMAT(Cal.Date, '%M') , City
ORDER BY month DESC , Total_Occupied DESC;

/* #13 Which amenities were highly preferred by customers*/
SELECT 
    A.Amenities, COUNT(R.ReviewID) AS Num_of_customers
FROM
    Listing AS L,
    Amenity AS A,
    Amenity_Listing AS AL,
    Review AS R
WHERE
    L.Listing_ID = R.Listing_ID
        AND L.Listing_ID = AL.Listing_ID
        AND A.AmenityID = AL.AmenityID
GROUP BY A.Amenities
ORDER BY Num_of_customers DESC;

/* #14 Total number of reviews received for each city by customers and what are their average overall ratings.*/
SELECT 
    L.City,
    COUNT(R.ReviewID) AS Num_of_Reviews,
    AVG(R.Overall_Experience) AS Avg_Rating
FROM
    Listing AS L
        JOIN
    Review AS R ON L.Listing_ID = R.Listing_ID
GROUP BY City
ORDER BY Avg_Rating DESC;

/* #15 Which property type was highly preferred among male and female customers*/
SELECT 
L.Property_Type,
    COUNT(CASE
        WHEN R.GENDER = 'Female' THEN L.Property_Type
    END) AS `Female_Pref`,
    COUNT(CASE
        WHEN R.GENDER = 'Male' THEN L.Property_Type
    END) AS `Male_Pref`
FROM
    Review AS R
        JOIN
    Listing AS L ON R.Listing_ID = L.Listing_ID
GROUP BY L.Property_Type;

/* # 16)	Which SuperHost Listing acommodates more than 4 people for apartment style property type, 
what are their monthly and total prices as well as for how many days they are available out of 365 days*/
SELECT 
    L.Listing_ID,
    L.Listing_name,
    H.HostID,
    H.HostName,
    H.HostSince,
    H.HostResponseTime,
    L.Availability_365,
    L.Monthly_Price,
    L.Price
FROM
    Listing AS L
        JOIN
    Host AS H ON L.HostID = H.HostID
WHERE
    H.HostSuperhost = 't'
        AND L.Property_Type = 'Apartment'
        AND L.Accomodates > 4;

/* #17 17)	Number of listing that SuperHost and NonSuperHost have and what are their 
average Overall, Cleanliness and Service ratings along with their average monthly price and average security deposit amounts.*/
SELECT 
"SuperHost" AS HostType,
    H.HostID,
    COUNT(L.Listing_ID) AS Num_of_Listings,
    AVG(R.Overall_Experience) AS Avg_Rating,
    AVG(R.Review_Cleanliness) AS Avg_Clean_Rating,
    AVG(R.Review_Service) AS Avg_Service_Rating,
    AVG(L.Monthly_Price) AS Avg_Monthly_Price,
    AVG(L.Security_Deposit) AS Avg_Sec_Dep
FROM
    Host AS H,
    Listing AS L,
    Review AS R
WHERE
    H.HostID = L.HostID
        AND L.Listing_ID = R.Listing_ID
        AND H.HostSuperhost = 't'
GROUP BY H.HostID
UNION 
SELECT 
"NonSuperHost" AS HostType,
    H.HostID,
    COUNT(L.Listing_ID) AS Num_of_Listings,
    AVG(R.Overall_Experience) AS Avg_Rating,
    AVG(R.Review_Cleanliness) AS Avg_Clean_Rating,
    AVG(R.Review_Service) AS Avg_Service_Rating,
    AVG(L.Monthly_Price) AS Avg_Monthly_Price,
    AVG(L.Security_Deposit) AS Avg_Sec_Dep
FROM
    Host AS H,
    Listing AS L,
    Review AS R
WHERE
    H.HostID = L.HostID
        AND L.Listing_ID = R.Listing_ID
        AND H.HostSuperhost = 'f'
GROUP BY H.HostID
ORDER BY HostType,Avg_Monthly_Price DESC;

/* #18 Total available listings per month and how many of those were booked by customers. 
This basically tells us how the demand varies across months for Airbnb. 
The Months 10,11,12 refers to October, November and December respectively.*/
SELECT A.bookingmonth AS Month, B.Total_Available, A.Bookings
FROM
    (SELECT 
        MONTH(Review.Date) AS bookingmonth, COUNT(Review.Date) AS Bookings
    FROM
        Review
    WHERE
        MONTH(Review.Date) > 9
    GROUP BY MONTH(Review.Date)) A
        JOIN
    (SELECT 
        MONTH(Calendar.Date) AS supplymonth, COUNT(Calendar.Date) AS Total_Available
    FROM
        Calendar
        WHERE Available = 't'
    GROUP BY MONTH(Calendar.Date)) B ON A.bookingmonth = B.supplymonth;
    
/* #19 What are the average prices each day of the month for the listings that are available in Washington and are the prices higher during weekends.*/
SELECT 
    DATE_FORMAT(Cal.Date, '%a') AS WkDay,
    AVG(Cal.Price) AS avg_price
FROM
    Calendar AS Cal
        JOIN
    Listing AS L ON Cal.Listing_ID=L.Listing_ID
WHERE
        L.City = 'Washington'
GROUP BY DATE_FORMAT(Cal.Date, '%a')
ORDER BY avg_price DESC;

/* #20 20)	How many hosts grouped by SuperHost and NonSuperHost have different types of cancellation policies where instant bookings are avaible. 
The “f” refer to NonSuperHost and “t” refers to SuperHost under HostSuperhost column */
SELECT 
    H.HostSuperhost,
    COUNT(H.HostID) AS Num_of_Hosts,
    L.cancellation_policy
FROM
    Listing AS L
        JOIN
    Host AS H ON L.HostID = H.HostID
    WHERE instant_bookable = 't'
GROUP BY H.HostSuperhost,cancellation_policy;

/* #21 Listings that received maximum number of reviews from customers and whose Overall rating is higher than the average total rating.*/
SELECT
    L.Listing_ID,
    L.Listing_name,
    COUNT(R.ReviewID) AS Num_of_Reviews,
    R.Overall_Experience,
    (SELECT AVG(Review.Overall_Experience) FROM Review) AS Avg_Rating
FROM
    Listing AS L
        JOIN
    Review AS R ON L.Listing_ID = R.Listing_ID
WHERE
    R.Overall_Experience > (SELECT AVG(Review.Overall_Experience) FROM Review)
    GROUP BY L.Listing_ID
    ORDER BY Num_of_Reviews DESC;
/*#22 22)	Listings that have TV,Air Conditioning and Free Parking on Premises as amenities, 
how much do they charge for cleaning and what are their monthly price sorted in descending order*/
SELECT 
DISTINCT L.Listing_ID, H.HostID,
	L.Listing_name,
    L.City,
    L.Availability,
    L.Monthly_Price,
    L.Cleaning_Fee
    FROM
    Listing AS L
    JOIN
    Host AS H ON L.HostID=H.HostID
    JOIN Amenity_Listing AS AL ON AL.Listing_ID = L.Listing_ID
    JOIN Amenity AS A ON A.AmenityID = AL.AmenityID
WHERE A.Amenities IN ('TV','Air Conditioning','Free Parking on Premises')
ORDER BY L.Monthly_Price DESC;

/* #23 Which SuperHost provide amenities ‘Cable TV', 'Internet', 'Wireless Internet', 
how many listings they have, in which city they are present and what are their average price and average overall rating by the customers.*/
SELECT 
    H.HostID,
    L.City,
    COUNT(L.Listing_ID) Num_of_Listings,
    H.HostResponseRate,
    AVG(L.Price) AS Avg_Price,
    AVG(R.Overall_Experience) AS Avg_Rating
FROM
    Listing AS L,
    Host AS H,
    Review AS R,
    Amenity AS A,
    Amenity_Listing AS AL
WHERE
    L.HostID = H.HostID
        AND L.Listing_ID = R.Listing_ID
        AND L.Listing_ID = AL.Listing_ID
        AND A.AmenityID = AL.AmenityID
        AND H.HostSuperhost = 't'
        AND A.Amenities IN ('Cable TV' , 'Internet', 'Wireless Internet')
GROUP BY H.HostID
ORDER BY Avg_Rating DESC;

/* #24 Number of amenities available at each listing grouped by hosts and what are their average monthly price.*/
SELECT 
    L.Listing_ID,
    L.Listing_name,
    L.HostID,
    COUNT(A.AmenityID) AS Num_of_Amenities,
    AVG(L.Monthly_Price) AS Avg_Monthly_Price
FROM
    Listing AS L
        JOIN
    Amenity_Listing AS AL ON AL.Listing_ID = L.Listing_ID
        JOIN
    Amenity AS A ON A.AmenityID = AL.AmenityID
GROUP BY L.HostID
ORDER BY Avg_Monthly_Price DESC;

/*#25 Hosts that have listed properties in Washington and that have Internet as amenity*/
SELECT 
	H.HostID,
    H.HostName,
    H.HostSince,
    H.HostLocation,
    H.phone
FROM
    Host AS H
WHERE
    H.HostID IN (SELECT 
            L.HostID
        FROM
            Amenity_Listing AS AL
                JOIN
            Listing AS L ON AL.Listing_ID=L.Listing_ID
            JOIN Amenity AS A ON A.AmenityID = AL.AmenityID
        WHERE L.City = 'Washington'
                AND A.Amenities = 'Internet'
        ORDER BY L.Monthly_Price);

/*#26 Private rooms in Washington which don’t require security deposit*/
SELECT 
    L.Listing_ID, L.Listing_name, L.Street, L.Room_Type, L.Price, A.Amenities, A.AmenityID
FROM
    Amenity_Listing AS AL
        JOIN
    Listing AS L ON AL.Listing_ID = L.Listing_ID
        JOIN
    Amenity AS A ON A.AmenityID = AL.AmenityID
WHERE L.City = 'Washington'
        AND A.Amenities = 'Internet'
        AND L.Room_Type = 'Private Room'
        AND L.Security_Deposit = '0'
ORDER BY L.Price DESC;

/*#27 Apartments in Washington which have internet and > 1 bedrooms and have moderate cancellation policy*/
SELECT 
    L.Listing_ID,
    L.Street,
    L.Listing_name,
    L.City,
    L.Bedrooms,
    L.Price,
    L.Monthly_Price
FROM
    Amenity_Listing AS AL
        JOIN
    Listing AS L ON AL.Listing_ID = L.Listing_ID
        JOIN
    Amenity AS A ON A.AmenityID = AL.AmenityID
WHERE
   L.City = 'Washington'
        AND A.Amenities = 'Internet'
        AND L.Room_Type = 'Entire home/apt'
        AND L.cancellation_policy = 'moderate'
        AND L.Property_Type = 'Apartment'
        AND L.Bedrooms > 1
	ORDER BY L. Monthly_Price DESC, L.Price DESC;

/*#28 What are the average deposits in Washington for each property types.*/
SELECT 
    L.Property_Type,
    AVG(L.Security_Deposit) AS Average_Deposit
FROM
    Listing AS L
WHERE
    L.HostID IN (SELECT 
            H.HostID
        FROM
            Host AS H
        WHERE
            H.HostLocation LIKE '%Washington%'
                AND H.HostResponseRate > 0.90)
GROUP BY L.Property_Type
ORDER BY Average_Deposit DESC;

/*#29 Average prices for different types of properties across different cities.*/
SELECT 
    L.City,
    L.Room_Type,
    AVG(L.Price) AS Average_Price
FROM
    Listing AS L
GROUP BY L.City , L.Room_Type
ORDER BY Average_Price DESC;

/*#30 The Listings which have Internet and Cable across various property types.*/
SELECT DISTINCT L.Listing_ID, L.Listing_name, L.HostID, L.Property_Type, A.Amenities
FROM
    Amenity_Listing AS AL JOIN Amenity AS A ON A.AmenityID = AL.AmenityID
    JOIN Listing AS L ON AL.Listing_ID = L.Listing_ID
WHERE
    A.Amenities IN ('Cable TV' , 'Internet')
    GROUP BY HostID;

/*#31 Total accommodations and total number of beds for each host and property type*/
SELECT 
    L.HostID,
    L.Property_Type,
    SUM(Accomodates) AS Total_Accomodation,
    SUM(Beds) AS Total_Beds,
    AVG(L.Price) AS Avg_Price
FROM
    Listing AS L
WHERE
    L.City = 'Washington'
GROUP BY L.Property_Type , L.HostID
ORDER BY Avg_Price DESC; 


 
 
 
 
 
 
 
